load("@rules_julia//julia:defs.bzl", "julia_standalone_binary") julia_standalone_binary(name, binary) A rule for converting a julia_binary to a standalone application. This rule uses PackageCompiler.jl to create a standalone executable that includes the Julia runtime and all dependencies. The resulting application can be distributed and run on machines without Julia installed. Dependencies are provided hermetically through Bazel - no network access required! PackageCompiler.jl and all Julia package dependencies are managed through the Bazel build system. Example: julia_binary( name = "my_app_bin", srcs = ["my_app.jl"], deps = ["//my/lib"],
) julia_standalone_binary( name = "my_app", binary = ":my_app_bin",
) ATTRIBUTES Name Description Type Mandatory Default name A unique name for this target. Name required binary The julia_binary target to convert into a standalone application Label required

