load("@rules_julia//julia/pkg:defs.bzl", "julia_pkg_test") julia_pkg_test(name, compiler) A test rule that verifies Manifest.bazel.json is in sync with Manifest.toml. This test ensures that the lockfile generated by pkg_compiler contains the correct package versions, UUIDs, and dependencies that match the Manifest.toml file. The test will fail if: A package is missing from the lockfile Versions don't match between the two files UUIDs don't match The git-tree-sha1 is not in the package URL SHA256 hashes are missing Example: julia_pkg_compiler( name = "pkg_update", project_toml = "Project.toml", manifest_toml = "Manifest.toml", # Normally optional but required for the `julia_pkg_test` target. manifest_bazel_json = "Manifest.bazel.json",
) julia_pkg_test( name = "pkg_sync_test", compiler = ":pkg_update",
) Then run: bazel test //:pkg_sync_test This will verify that both manifest files are synchronized. If they're out of sync, the test will fail with detailed error messages indicating what needs to be fixed. ATTRIBUTES Name Description Type Mandatory Default name A unique name for this target. Name required compiler The julia_pkg_compiler target Label required
